import React, { useEffect, useState } from 'react'
import Modal from 'react-bootstrap/Modal'
import Button from 'react-bootstrap/Button'
import { useNavigate } from 'react-router-dom'
import useGAAnalytics from '../../hooks/useGAAnalytics'
import { Mixpanel } from '../../hooks/useMixpanel'
import { list } from '../../constants/productList'

const Details = () => {

    const [logindata, setLoginData] = useState([]);
    const history = useNavigate();
    const { gtag } = useGAAnalytics();

    useEffect(() => {
        gtag('page_view', {
            page_title: 'Home',
            page_location: window.location.href
        });

        //mixpanel
        Mixpanel.track('Page View', {
            page_title: 'Home',
            page_location: window.location.href
        });
    }, [])


    const getUserDetails = () => {
        const getuser = localStorage.getItem("user_login");
        if (getuser && getuser.length) {
            const user = JSON.parse(getuser);
            setLoginData(user);
        } else {
            history("/login");
        }
    }

    useEffect(() => {
        getUserDetails();
    }, [])

    return (
        <div className='container-wrapper'>
            {
                logindata.length === 0 ? "No Data Found" :
                    <>
                        <h2>{`Analytics Tools`}</h2>
                        <div class="wrappers">
                            <div class="container">
                                <div class="row g-1">
                                    {list.map(content => (

                                        // <li>
                                        //     <div className="product">
                                        //         <div className="product-image">
                                        //             <img src={content.image} />
                                        //         </div>
                                        //         <div className="product-imformation">
                                        //             <h4>{content.name}</h4>
                                        //             <div className="specification">
                                        //                 <span>{content.ram} RAM</span>
                                        //                 <small className="line"></small>
                                        //                 <span>{content.ssd} SSD</span>
                                        //             </div>
                                        //             <span>${content.price}</span>
                                        //         </div>
                                        //     </div>
                                        // </li>
                                        <div className="col-md-3">
                                            <div className="card p-3">
                                                <div className="text-center"> <img src="https://i.imgur.com/emb60L5.jpg" width="200" /> </div>
                                                <div className="product-details">
                                                    <span className="font-weight-bold d-block">$ 7.00</span>
                                                    <span>Red Redish</span>
                                                    <div className="buttons d-flex flex-row">
                                                        <div className="cart">
                                                            <i className="fa fa-shopping-cart"></i>
                                                        </div>
                                                        <button className="btn btn-success cart-button btn-block">
                                                            <span className="dot">1</span>Add to cart
                                                        </button>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    ))
                                    }

                                </div>
                            </div>

                        </div>
                    </>
            }
        </div>
    )
}

export default Details
